import React from 'react'

const FormSuccess = () => {
    return (
        <div className="form-content-right">
            <div className="form-success">WE have received
            your request!</div>
            <img src='img/img-3.svg' alt='success-image' 
            className='form-image-2'/>
        </div>
    )
}

export default FormSuccess
